<template>

  <div @change="resize" id="plotter"></div>

    
</template>

<script>
import {mapGetters} from 'vuex'
import Plotly from 'plotly.js'

export default {
  data () {
    return {
      layout: null,
      zones: [],
      zoneColorDead: 'rgba(0,0,0,0.7)',
      redZone: 'rgba(244, 22, 22, 0.6)',
      yellowZone: 'rgba(212, 216, 75, 0.6)',
      greenZone: 'rgba(28, 201, 114, 0.6)',
      zoneText: []
    }
  },
  computed: {
    ...mapGetters({
      trackingData: 'trackingData',
      sessionStats: 'sessionStats'
    })
  },
  methods: {
    fill () {
      let textSize = 22
      if (innerWidth < 1300) {
        textSize = 14
      }
      // console.log('ZONE SUMMARY FILL INITIATED')
      let x0Vals = [-10, -3.32, 3.35, -10, -3.32, 3.35]
      let x1Vals = [-3.32, 3.35, 10, -3.32, 3.35, 10]
      let y0Vals = [0, 0, 0, -10, -10, -10]
      let y1Vals = [10, 10, 10, 0, 0, 0]
      let zoneDesc = null
      let zoneColor = null
      let zoneTextX = []
      let zoneTextY = []
      let zoneTextVal = []
      let jsonZones = ['Deep Left', 'Deep Middle', 'Deep Right', 'Short Left', 'Short Middle', 'Short Right']
      // loop through data
      for (let i = 0; i < 6; i++) {
        // check if rating is null
        if (this.sessionStats.zoneimage[jsonZones[i]].rating === null) {
          zoneColor = this.zoneColorDead
        }
        if (this.sessionStats.zoneimage[jsonZones[i]].rating !== null) {
          // compare rating
          zoneDesc = this.sessionStats.zoneimage[jsonZones[i]].ystr
          if (this.sessionStats.zoneimage[jsonZones[i]].rating < 50) {
            zoneColor = this.redZone
          } else if (this.sessionStats.zoneimage[jsonZones[i]].rating > 50 && this.sessionStats.zoneimage[jsonZones[i]].rating < 85) {
            zoneColor = this.yellowZone
          } else if (this.sessionStats.zoneimage[jsonZones[i]].rating > 85) {
            zoneColor = this.greenZone
          }
          zoneTextX.push(x0Vals[i] + 3.34, x0Vals[i] + 3.34)
          zoneTextY.push(y0Vals[i] + 6.3, y0Vals[i] + 5)
          zoneTextVal.push(jsonZones[i], zoneDesc)
          this.zoneText = {
            x: zoneTextX,
            y: zoneTextY,
            mode: 'markers+text',
            marker: {
              color: zoneColor,
              size: 1
            },
            text: zoneTextVal,
            textposition: 'bottom',
            layer: 'above',
            textfont: {
              size: textSize,
              color: 'rgb(0,0,0)'
            },
            type: 'scatter'
          }
        }
        this.zones.push({
          type: 'rect',
          layer: 'above',
          xref: 'x',
          x0: x0Vals[i],
          x1: x1Vals[i],
          yref: 'y',
          y0: y0Vals[i],
          y1: y1Vals[i],
          fillcolor: zoneColor,
          line: {
            color: '#ffffff'
          }
        })
      }
    },
    resize () {
      Plotly.Plots.resize('plotter')
    }
  },
  mounted () {
    this.fill()

    this.layout = {
      paper_bgcolor: null,
      plot_bgcolor: 'rgba(0,0,0,0)',
      grid: {
        domain: {
          x: [-10, 10],
          y: [-10, 10]
        }
      },
      xaxis: {
        range: [-10, 10],
        showgrid: false,
        showlegend: false,
        zeroline: false,
        ticks: '',
        fixedrange: false,
        showline: true,
        autotick: true,
        hoverlabel: false,
        showticklabels: false
      },
      // for deployment: this.routeData.MinY, this.routeData.MaxY
      // for testing: this.trackingData['qbtrackingdata'][this.sliderTime]['y'] -7.5,this.trackingData['qbtrackingdata'][this.sliderTime]['y'] + 20
      yaxis: {
        range: [-10, 10],
        showgrid: true,
        showlegend: false,
        fixedrange: false,
        hoverlabel: false,
        zeroline: false,
        ticks: '',
        showline: true,
        autotick: true,
        showticklabels: false
      },
      margin: {
        t: 0, // top margin
        l: 0, // left margin
        r: 0, // right margin
        b: 0 // bottom margin
      },
      showlegend: false,
      shapes: this.zones,
      autosize: true,
      images: [{
        layer: 'above',
        opacity: '0.13',
        x: -10,
        y: 10,
        sizex: 20,
        sizey: 20,
        source: 'data:image/jpeg;base64,',
        sizing: 'stretch',
        xref: 'x',
        yref: 'y'
      }]

    }
    // console.log(innerWidth)
    Plotly.plot('plotter', {
      data: [this.zoneText, this.zones],
      layout: this.layout
    }
      , {displayModeBar: false})
  }
}
</script>
